			 e.keyCode === 83 || 
             e.keyCode === 85 || 
			 e.keyCode === 80 || 
			 e.keyCode === 123 ||

             e.keyCode === 74 ||

        }

    e.preventDefault();
    alert('PROIBIDO');
    return false;
  }
});

    if (event.keyCode == 123) { 
        return false;
    } else if (event.ctrlKey && event.shiftKey && event.keyCode == 73) {       
        return false;
    }
});
$(document).on("contextmenu", function (e) {        
    e.preventDefault();
});

    setTimeout(devtoolIsOpening, 100);
}
